import React from 'react'
import { Link } from 'react-router-dom'

export default function Resume(props) {
    return(
        <div className="resume">
            <p>{props.resume.title}<Link to='/ShowPage' >Show</Link></p>
            <p>{props.resume.level}</p>
        </div>
    )
}
